import React, { Component } from 'react';
import Todo from "./components/Todo";
import './App.css';

class Header extends Component {
  render() {
    return (
      <nav className="nav">
        <div className="logo-container"></div>
        <ul className="list-items">
          <li className="list">
            <a href="#" className="link"> Notes </a>
          </li>
          <li className="list">
            <a href="#" className="link"> Lists </a>
          </li>
          <li className="list">
            <a href="#" className="link"> Recordings </a>
          </li>
          <li className="list">
            <a href="index.html" className="link"> </a>
          </li>
        </ul>
      </nav>
    );
  }
}

class Footer extends Component {
  render() {
    return (
      <nav className="nav">
        <div className="logo-container"></div>
        <ul className="list-items">
          <li className="list">
            <a href="#" className="link"> Home </a>
          </li>
          <li className="list">
            <a href="#" className="link"> Add </a>
          </li>
          <li className="list">
            <a href="#" className="link"> Profile </a>
          </li>
          <li className="list">
            <a href="index.html" className="link"> </a>
          </li>
        </ul>
      </nav>
    );
  }
}

class Search extends Component {
  render() {
    return (
      <center>
        <div className="topnav">
          <input type="text" placeholder="Search.." />
        </div>
      </center>
    );
  }
}

class Notes extends Component {
  render() {
    const boxStyle = {
      width: '200px',
      height: '200px',
      margin: '10px',
      padding: '10px',
      borderRadius: '25px',
    };

    const { listItems } = this.props;

    return (
      <div>
        <center>
          {listItems.map((item, index) => (
            <div key={index} style={{ ...boxStyle, background: '#FFFFFF' }}>
              <p>{item}</p>
            </div>
          ))}
        </center>
      </div>
    );
  }
}

class List extends Component {
  render() {
    return (
      <div className="todoapp stack-large">
        <Search />
        <Header />
        <Notes />
        {/* ... (existing code) */}
      </div>
    );
  }
}

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      listItems: ['Item 1', 'Item 2', 'Item 3'], // Replace this with your actual list items
    };
  }

  render() {
    return (
      <div className="todoapp stack-large">
        <Search />
        <Header />
        <Notes listItems={this.state.listItems} />
        {/* ... (existing code) */}
      </div>
    );
  }
}

export default App;
